gIndex = 1

function request()
   local headers = { }
   method = "GET"
   headers['Content-Type'] = "application/json"
   if (gIndex > 200)
   then
      gIndex = 1
   end
   -- print(gIndex)
   -- print(sessionIds[gIndex])
   headers["Cookie"] = "sessionId=" .. sessionIds[gIndex]
   body = "" 

   gIndex = gIndex + 1
   return wrk.format(method, nil, headers, body)
end

function response(status, headers, body)  
   if status ~= 200 then  
      print("http status error: ", body)  
      wrk.thread:stop()  
   elseif(not string.find(body, '"code":0')) then
      print("resp code error: ", body)  
      wrk.thread:stop()  
   end
end  
